         <div className = "expense-item"> 
            <div>
                March 28th 2021
            </div>
            <div className="epense-item__description">
                <h2>{expenseTitle}</h2>
            </div>
            <div className="expense-item__price">$(expenseAmount)</div>
         </div>

    );
}

